import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { getProducts } from '../../store/ProductsSlice'
import style from './Products.module.scss'


export default function Products() {
 const {products} = useSelector(state=>state.products)
const dispatch = useDispatch()

useEffect(() => {
 dispatch(getProducts())
}, [dispatch])
const changeImage = (e)=>{
   products.forEach((item) => {
       e.target.src = item.images[1]
      });
}
  return (
    <>
    <div className={`${style.products} py-5`}>
        <div className="container">
            <div className={`${style.title}`}>
                <h2>Products</h2>
                <p>Trendy</p>
            </div>
            <div className="row py-3">
                {products.map((item)=>
                <div className="col-lg-3 col-md-4" key={item.id}>
                <div className={`${style.item}`} >
                    <img src={item.images[0]} alt="" className='w-100' onMouseOver={e => (e.currentTarget.src = item.images[1])}
                     onMouseOut={e => (e.currentTarget.src = item.images[1])} />
                    <h3 className={`${style.Itemtitle}`}>{item.title}</h3>

                </div>

            </div>
                )}

            </div>
        </div>
    </div>
    </>
  )
}
